import {
  PopoverTrigger,
  PopoverContent,
  PopoverHeader,
  PopoverBody,
  PopoverFooter,
  PopoverArrow,
  PopoverCloseButton,
  PopoverAnchor,
} from '@chakra-ui/react';

function Swap() {
  return (
    <div className="content">
      <div className='tradeBox'>
        <div className="tradeBoxHeader">
          <h3>Swap</h3>
          <SettingsIcon className='cog' />
        </div>
      </div>
    </div>

  )
}

export default Swap
